import React, { Component } from 'react';
import logo from './logo.svg';
import Form from "react-jsonschema-form";
import {Button,Navbar,Tabs,Tab,DropdownButton,Grid,Alert,TabContent} from "react-bootstrap";
import {Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle,CardImgOverlay} from 'reactstrap'
//import './App.css';
import Empl from  './components/employee_details'
class App extends Component {
  render() {
    return (
      <div className="App">
       <Navbar fixedTop = 'true'  inverse>
        <Tabs defaultActiveKey={1} id="uncontrolled-tab-example">
          <Tab eventKey={1} title  = "TAB_1">
            <br /><br /><br /><br />
           TAB
            </Tab>
          <Tab eventKey={2} title  = "TAB_2" >
            <br />
            <br />
            <br />
            <TabContent><Empl /></TabContent>
          </Tab>
          <Tab eventKey={3} title = "TAB_3">TAB 3</Tab>
          <Tab eventKey={4}  title  = "TAB_4">TAB 4</Tab>
        </Tabs>
        </Navbar>
      </div>
    );
  }
}

export default App;
